    "A plan for the management of the Kodiak brown bear",nt"tracking_summary":
    {ntt"total": 3,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T23:03:11.600137",nt"name": "a-plan-for-the-management-of-the-kodiak-brown-bear",nt"isopen":
    false,nt"url": null,nt"notes": "Management districts will be used as a
    tool to manage the population of bear on Kodiak Island. Theoretically, 204 bear
    may be taken off the refuge annually without undue harm to the population. Hunting
    will be allowed according to the regulations of the Alaska Game Commission. Electric
    fence should be used as an exclosure to bear on the small red salmon streams. Any
    ranching expansion should be limited to the area on the Chimiak Peninsula and on
    the small islands outside of the refuge. Cooperation will be extended in every phase
    of the bear-cattle problem within reason and policy. The most desirable type of
    control in the ranching area is a control that requires only a small amount of attention.
    It is recommended that the road from middle Bay to Saltery Cove be repaired and
    put into useable condition, to increase activity in the ranching area.",nt"license_title":
